/*Table structure for table `t_product` */

DROP TABLE IF EXISTS `t_product`;

CREATE TABLE `t_product` (
  `id` int NOT NULL AUTO_INCREMENT,
  `type_id` int DEFAULT NULL COMMENT '商品类型',
  `price` decimal(10,2) DEFAULT NULL COMMENT '价格',
  `product_name` varchar(100) DEFAULT NULL COMMENT '商品名称',
  `product_img` text COMMENT '商品图片',
  `product_details` text COMMENT '商品详情',
  `product_num` int DEFAULT NULL COMMENT '库存数量',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(100) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_by` varchar(100) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='商品信息';

