58','java1234');

/*Table structure for table `t_shopping_cart` */

DROP TABLE IF EXISTS `t_shopping_cart`;

CREATE TABLE `t_shopping_cart` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键Id',
  `user_id` int DEFAULT NULL COMMENT '用户id',
  `table_id` int DEFAULT NULL COMMENT '关联id',
  `num` int DEFAULT NULL COMMENT '数量',
  `price` decimal(10,2) DEFAULT NULL COMMENT '价格',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(100) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_by` varchar(100) DEFAULT NULL COMMENT '修改人',
  `status` varchar(10) DEFAULT '1' COMMENT '是否结算（0：是，1：否）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=76 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='购物车';

